/******************************************************************************
* 函数名: convertBinaryField
* 功  能: 
* 函数存储类型:
* 参数:
* 参数名        类型        输入/输出       描述
* 返回值: 0 正常，其他错误
* 说明:
******************************************************************************/
int  convertBinaryField(char *p, unsigned int *pVal)
{
	unsigned int val;
	unsigned int i;
	
	val = 0;
	while ((*p != '\0') && (i < 32))
	{
		val = (val<<1) | (*p - '0');
		++i;
	}
	*pVal = val;
	return(i/8);
}


/******************************************************************************
* 函数名: removeLastStar
* 功  能: 
* 函数存储类型:
* 参数:
* 参数名        类型        输入/输出       描述
* 返回值: 0 正常，其他错误
* 说明:
******************************************************************************/
void removeLastStar(char *p)
{
	int i;
	i = 0;
	while (*p != '\0')
	{
		++i;
		++p;
	}
	
	if (i == 0)
	    return;  // empty string
	    
	while ((*p != '*') && i)
	{
	    --p;
	    --i;
	}
	if (i)
	    *p = '\0';  // replace last '*' with NULL, end line at that spot
}

/******************************************************************************
* 函数名: bsp_convert_cpld_jed
* 功  能:
* 函数存储类型:
* 参数:
* 参数名        类型        输入/输出       描述
* 返回值: 0 正常，其他错误
* 说明:
******************************************************************************/	    
int bsp_convert_cpld_jed(void)
{
	FILE *fpIn, *fpOut;
	unsigned char flag;
	unsigned char frame[17];
	unsigned char line[MAX_LINE + 1];
	int i, j;
	int pageCnt, UFMPageCnt, CfgPageCnt;
	int byteCnt;
	int rle;
	int compress;
	int done;
	int state;
	int fuse_addr;
	int fuse_size;
	int erase_val;
	int security_fuse;
	unsigned int userCode;
	char *pName;
	char outCFileStr[256];
	char outHFileStr[256];
	XO2Devices_t devID;

	devID =	MachXO2_4000;

	fpIn = fopen(CPLD_JED_FILE_NAME, "r");
	if (fpIn == NULL)
	{
		printf("Opening input jed  file!\n");
		return BSP_ERROR;
	}

	pageCnt = 0;
	UFMPageCnt = 0;
	CfgPageCnt = 0;
	byteCnt = 0;
	compress = TRUE;

	/*读一行代码*/
	fgets(line, MAX_LINE, fpIn); 
	if (line[0] != STX)  //开始标识
    {
		printf("ERROR!  Expected STX as first char!\nAborting.\n");
		fclose(fpIn);
		exit(-2);
	}

	done = FALSE;
	while (!feof(fpIn)  && !done)
	{   
	  	/* 解析文件模块标识*/
   		if (fgets(line, MAX_LINE, fpIn) != NULL)
   		{
			if ((line[0] == '0') || (line[0] == '1'))
			    state = FUSE_DATA;
			else if (strncmp("NOTE", line, 4) == 0)
			    state = COMMENT;
			else if (line[0] == 'G')
			    state = SECURITY_FUSE;
			else if (line[0] == 'L')
			    state = FUSE_LIST;
			else if (line[0] == 'C')
			    state = FUSE_CHECKSUM;
			else if (line[0] == '*')
			    state = END_DATA;
			else if (line[0] == 'D')
			    state = FUSE_DEFAULT;
			else if (line[0] == 'U')
			    state = USER_CODE;
			else if (line[0] == 'E')
			    state = FEATURE_ROW;
			else if (strncmp("QF", line, 2) == 0)
			    state = FUSE_SIZE;
			else if (line[0] == ETX)
			    state = DONE;


			switch (state)
			{
				case FUSE_DATA:
    					++pageCnt;
    					if(pageCnt == 5760)
    					{
    						printf("pageCnt = %d %d\n",pageCnt, XO2DevList[devID].Cfgpages);	
    					}
    					if (pageCnt <= XO2DevList[devID].Cfgpages)
    					{
                            convertFuseToHexArray(line);
    					}

					break;
					
				case COMMENT:
					removeLastStar(line);
					break;

				case FUSE_LIST:
					removeLastStar(line);
		   		    sscanf(&line[1], "%d", &fuse_addr);
		   		    if (fuse_addr == 0)
		   		    {
		   		    	//printf("fuse_addr == 0!\n");
   					}
					break;

				case SECURITY_FUSE:
					removeLastStar(line);
		   		    sscanf(&line[1], "%d", &security_fuse);
					break;

				case FUSE_DEFAULT:
					removeLastStar(line);
		   		    sscanf(&line[1], "%d", &erase_val);
		   		    if (erase_val != 0)
		   		        printf("WARNING!  DEFAULT ERASE STATE NOT 0!\n");
					break;

				case FUSE_SIZE:
					removeLastStar(line);
		   		    sscanf(&line[2], "%d", &fuse_size);
					printf("fuse size = %d!\n",fuse_size);
					break;

				case USER_CODE:   // This is informational only.  USERCODE is part of Config sector
					removeLastStar(line);
					if (line[1] == 'H')
			   		    sscanf(&line[2], "%x", &userCode);
					else
					    convertBinaryField(&line[1], &userCode);					
					//printf("userCode = %x!\n",userCode);
			    	break;
					
				case FEATURE_ROW:
					convertFeatureRowToHexArray_feature(&line[1],8);
					fgets(line, MAX_LINE, fpIn);
					removeLastStar(line);
					convertFeatureRowToHexArray_feabits(&line[0],2);
					break;

				case DONE:
					done = TRUE;
					break;

				case END_DATA:
					break;
					
				case FUSE_CHECKSUM:
					break;

				default:
                    // do nothing
					break;
			}

			//先确定型号
			// Look for specific XO2 Device type and extract
			if ((state == COMMENT)  && (strncmp("DEVICE NAME:", &line[5], 12) == 0))
			{
				findDeviceType(&line[17], &devID);
			}
		}
	}

    /*得到cpld_cfgDate[]长度*/
    cpld_cfg_cnt  = XO2DevList[devID].Cfgpages*16;	
	fclose(fpIn);
    return 0;
}

/******************************************************************************
* 函数名: convertFuseToHexArray
* 功  能: 
* 函数存储类型:
* 参数:
* 参数名        类型        输入/输出       描述
* 返回值: 0 正常，其他错误
* 说明:
* Convert a line of fuse data into a list of C byte values in an array.
* This function is specific to the MachXO2 format of 128 bits per page (fuse row).
* So it just processes knowing that there are 16 bytes per row.
*
* JEDEC file format is lsb first so shift into byte from top down.
******************************************************************************/
void convertFuseToHexArray(char *p)
{
	unsigned char val;
	int i, j;

	for (i = 0; i < 16; i++)
	{
		val = 0;
		for (j = 0; j < 8; j++)
		{
			val = (val<<1) | (*p - '0');
			++p;
		}

		cpld_CfgData[Cfg_Cnt++] = val;
#define CPLD_DEBUG 1
		#if CPLD_DEBUG
		if(Cfg_Cnt%0x100==0)
		printf("cpld_CfgData[%x] = %x\n",Cfg_Cnt-1,cpld_CfgData[Cfg_Cnt-1]);
		#endif
	}
#undef CPLD_DEBUG
}

